import React from "react";
import "../src/stylesheets/styles.scss";
import { StoryCard } from "./Storycard/index";
import { SuggestedSource } from "./Source";

function App() {
  return (
    <div>
      <div className="app">
        <div className="card-wrapper">
          <StoryCard />
          <StoryCard />
        </div>

        <SuggestedSource />
      </div>
      <div className=".boxShadow">MARK All AS READ</div>
    </div>
  );
}

export default App;
